
import './App.css';
import { useState, useEffect, useRef } from "react";

function App() {

  // ------------ PAGE STATE ------------
  const [screen, setScreen] = useState("start"); // "start" or "game"
  const [difficulty, setDifficulty] = useState("easy");

  // ------------ GAME STATE ------------
  const [score, setScore] = useState(0);
  const [currentHole, setCurrentHole] = useState(null);
  const [timeLeft, setTimeLeft] = useState(30);
  const [gameOver, setGameOver] = useState(false);

  const holesRef = useRef([]);
  const moleRef = useRef(null);
  const intervalRef = useRef(null);
  const timerRef = useRef(null);

  // Image sources
  const moleSrc = "data:image/png;base64,";
  const holeSrc = "data:image/png;base64,";

  // Difficulty settings
  const settings = {
    easy: { speed: 2000 },
    medium: { speed: 1500 },
    hard: { speed: 1000 },
  };

  // ------------ START GAME ------------
  const startGame = () => {
    const { speed } = settings[difficulty];

    setScore(0);
    setGameOver(false);
    setCurrentHole(null);
    setTimeLeft(30);

    // Create mole element
    const mole = document.createElement("img");
    mole.src = moleSrc;
    mole.classList.add("mole");
    mole.addEventListener("click", handleMoleClick);
    moleRef.current = mole;

    // Mole movement interval
    intervalRef.current = setInterval(moveMole, speed);

    // Countdown timer
    timerRef.current = setInterval(() => {
      setTimeLeft((prev) => {
        if (prev <= 1) {
          endGame();
          return 0;
        }
        return prev - 1;
      });
    }, 1000);
  };

  // ------------ STOP GAME ------------
  const stopGame = () => {
    clearInterval(intervalRef.current);
    clearInterval(timerRef.current);
  };

  // ------------ END GAME ------------
  const endGame = () => {
    stopGame();
    setGameOver(true);

    if (currentHole !== null) {
      holesRef.current[currentHole]?.removeChild(moleRef.current);
    }

    setCurrentHole(null);
  };

  // ------------ GO BACK TO MENU ------------
  const returnToMenu = () => {
    stopGame();

    // Remove mole from hole
    if (currentHole !== null) {
      holesRef.current[currentHole]?.removeChild(moleRef.current);
    }

    setCurrentHole(null);
    setScreen("start");
  };

  // ------------ MOLE MOVEMENT ------------
  const moveMole = () => {
    if (gameOver) return;

    const mole = moleRef.current;

    if (currentHole !== null) {
      holesRef.current[currentHole]?.removeChild(mole);
    }

    const newHole = Math.floor(Math.random() * 3);
    holesRef.current[newHole].appendChild(mole);
    setCurrentHole(newHole);
  };

  // ------------ CLICKING THE MOLE ------------
  const handleMoleClick = () => {
    if (gameOver) return;

    setScore((prev) => prev + 1);

    moveMole();

  };

  // ------------ START BUTTON PRESSED ------------
  const handleStartButton = () => {
    setScreen("game");
    setTimeout(startGame, 50); // wait for DOM render
  };

  // ==============================================
  // RENDER START SCREEN
  // ==============================================
  if (screen === "start") {
    return (
      <main style={{ textAlign: "center", marginTop: "50px" }}>
        <h1>Whack-a-Mole</h1>
        <p style={{ fontSize: "1.2em" }}>Click on a mole</p>
        <img src={moleSrc} alt="Mole" style={{ width: "4em" }}/>
        <p style={{ fontSize: "1.2em" }}> before it disappears to earn a point!</p>
        <h2>Select Difficulty</h2>

        <select
          value={difficulty}
          onChange={(e) => setDifficulty(e.target.value)}
          style={{ padding: "10px", fontSize: "18px" }}
        >
          <option value="easy">Easy (2s)</option>
          <option value="medium">Medium (1.5s)</option>
          <option value="hard">Hard (1s)</option>
        </select>

        <br />
        <button
          onClick={handleStartButton}
          style={{
            marginTop: "1.5em",
            padding: "0.4em 1.1em",
            fontSize: "1.2em",
            cursor: "pointer",
          }}
        >
          Start Game
        </button>
      </main>
    );
  }

  // ==============================================
  // RENDER GAME SCREEN
  // ==============================================
  return (
    <main>
      <section>
        <h1>Whack a Mole! ({difficulty.toUpperCase()})</h1>
        <h2>Score: {score}</h2>
        <h2>Time Left: {timeLeft}s</h2>

        {/* Back to menu button WHILE PLAYING */}
        {!gameOver && (
          <>
          <button
            onClick={returnToMenu}
            style={{
              marginBottom: "20px",
              padding: "8px 20px",
              fontSize: "16px",
              cursor: "pointer",
            }}
          >
            Back to Menu
          </button>
          <br />
          </>
        )}

        {/* After game over */}
        {gameOver && (
          <>
            <h2>Game Over!</h2>
            <button onClick={returnToMenu}>Back to Menu</button>
          </>
        )}

        {[0, 1, 2].map((i) => (
          <div
            key={i}
            className="hole_container"
            ref={(el) => (holesRef.current[i] = el)}
          >
            <img className="hole_imgs" src={holeSrc} alt="Hole" />
          </div>
        ))}
      </section>
    </main>
  );
}

export default App;